import '../CSS/NavBar.css';
import { Link } from '@reach/router'

const NavBar = ({ toggleSidebar }) => {
  return (
    <nav className="navBar">
      {/* <div class="navBar-closeIcon" onClick={() => toggleSidebar('sidebar')}>
        <i class="fas fa-times" ></i>
      </div> */}
      <div>close</div>
      <ul className="navList">
        <Link className="navListItem" to="/">Home</Link>
        <Link className="navListItem" to="/topics"> Topics</Link >
        <Link className="navListItem" to="/articles"> Articles</Link >
        <Link className="navListItem" to="/users"> Users</Link >
      </ul>
    </nav>
  );
};

export default NavBar;
